import { Home } from '../home/home'

import "./login.css"

export class Login extends React.Component {

    constructor(props) {
        super(props);
        this.state = {email: '', password: ''};

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }

        myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    this.setState({[nam]: val});
  }

      handleSubmit(event) {
        alert('A name was submitted: ' + this.state.email + this.state.password);
        event.preventDefault();
      }

    render() {
        return(
            <div className="loginSiteWrapper">
                <form className="loginFormWrapper" >
                <h1>Hello {this.state.username} {this.state.age}</h1>
                    <input className="loginFormInput" type="text" name="email" placeholder="email" onChange={this.myChangeHandler}/>
                    <input className="loginFormInput" type="password" name="password" placeholder="password"  onChange={this.myChangeHandler}/>

                    <button className="loginFormButton" type="submit" value="Submit"/>
                </form>
            </div>
        )
    }

}

export default Login;
